import * as React from 'react';
import { Container, Paper } from "@mui/material";
import Box from "@mui/material/Box";

async function list() {
    const endpoint = 'http://localhost:8080/person/getAll';
    const response = await fetch(endpoint);
    const data = await response.json();
    console.log(data.value);
    return data.value;
}

export default function Users() {
    const [users, setUsers] = React.useState([]); // Используем useState для хранения данных

    const paperStyle = {
        padding: "50px 20px",
        width: "95%",
        margin: "20px auto",
        borderRadius: 20,
        backgroundColor: "#e9dbd3"
    }

    return (
        <Container>
            <Paper elevation={3} style={paperStyle}>
                <Box>
                    <div>
                        <button id="list" onClick={async () => {
                            const userList = await list();
                            setUsers(userList); // Обновляем состояние с полученными данными
                        }}>List</button>
                        <div>
                            {users && users.map(user => (
                                <div key={user.id}>
                                    <p>{user.name}</p>
                                    <p>{user.age}</p>
                                </div>
                            ))}
                        </div>
                    </div>
                </Box>
            </Paper>
        </Container>
    );
}
